import React from "react";
import {
  View,
  Text,
  TouchableOpacity,
  Image,
  SafeAreaView,
  TextInput,
  FlatList,
} from "react-native";
import {
  COLORS,
  FONTS,
  SIZES,
  images,
  dummyData,
  icons,
} from "../../constants";

const HomeHeader = () => {
  return (
    <View
      style={{
        flexDirection: "row",
        marginHorizontal: SIZES.padding,
        alignItems: "center",
        height: 80,
      }}
    >
      {/* Text */}
      <View
        style={{
          flex: 1,
        }}
      >
        <Text
          style={{
            color: COLORS.darkGreen,
            ...FONTS.h2,
          }}
        >
          Hello Bashkim,
        </Text>

        <Text
          style={{
            marginTop: 3,
            color: COLORS.gray,
            ...FONTS.body3,
          }}
        >
          What do you want to cook today?
        </Text>
      </View>

      {/* Profile Image */}

      <TouchableOpacity>
        <Image
          source={images.profile}
          style={{
            width: 50,
            height: 50,
            borderRadius: 25,
          }}
        />
      </TouchableOpacity>
    </View>
  );
};

export default HomeHeader;
